import React from "react";
import Footer from "./components/Home/Footer";
import Section2 from "./components/Home/Section2";
import Header from "./components/Home/header";
import Section1 from "./components/Home/section1";

function Home() {

    return(
        <div>
            <Header />
            <Section1 />
            <Section2 />
            <Footer />

        </div>
    )

}
export default Home;
